- input: "TEXT\x1CC00250209\x1C2\x1CB207492\x1CSB23\x1C\"This amendment is filed in
    response to the Commission's Request for Additional Information (RFAI) dated May
    30, 2008.  The RFAI noted a that a contribution originally disclosed on the April
    Monthly Report to Dutch Ruppersberger for Congress was designated to the Primary
    election after the Maryland Primary election date of 2/12/08.  In reviewing our
    records and those filed by the candidate's committee, we discovered that the contribution
    originally disclosed with a date of 3/7/08 should have been disclosed with a date
    of 2/10/08.  Thus we provide this amendment to disclose the transaction in the
    correct reporting period (see page 15).  The election designation is correct.
    \ Please update your records accordingly with the correct date.\""
